var address = {
    addrId: 0,
    parentId: 0,
    grade: 1,
    perId: "",
    attribute: "",
    addressValue: ""
}
$(function () {
    /*初始化一级地址*/
    address.attribute = eval(addressAll);
    $.extend({
        initAddr: function (proName, cityName, secName) {
            $('select[addr="province"] option').each(function () {
                var pro = $(this).text();
                if (pro == proName){
                    $(this).attr("selected",true);
                    address.addrId = $(this).attr("id");
                    $.cityOpt(address.addrId);
                    $.initAddrCity(cityName, secName);
                }
            })
            $('select[provinceClick="true"]').trigger("chosen:updated.chosen");
            $('select[cityClick="true"]').trigger("chosen:updated.chosen");
            $('select[sectionClick="true"]').trigger("chosen:updated.chosen");
        },
        initAddrCity: function (cityName, secName) {
            $('select[addr="city"] option').each(function () {
                var pro = $(this).text();
                if (pro == cityName){
                    $(this).attr("selected",true);
                    address.addrId = $(this).attr("id");
                    $.sectionOpt(address.addrId);
                    if(secName != undefined){
                        $.initAddrSec(secName);
                    }
                }
            })
        },
        initAddrSec: function (name) {
            $('select[addr="section"] option').each(function () {
                var pro = $(this).text();
                if (pro == name){
                    $(this).attr("selected",true);
                }
            })
        },
        provinceOpt: function (id) {
            var html = this.attribute(id);
            $('select[addr="province"]').append(html);
        },
        cityOpt: function (id) {
            var html = this.attribute(id);
            $('select[addr="city"]').html("").append(html);
            address.addrId = $('select[addr="city"] option:first').attr("id");
            this.sectionOpt(address.addrId);
        },
        sectionOpt: function (id) {
            var html = this.attribute(id);
            if (html == ""){
                $('select[addr="section"]').parent().hide();
                $('select[addr="province"]').parent().removeClass("col-lg-4").addClass("col-lg-6");
                $('select[addr="city"]').parent().removeClass("col-lg-4").addClass("col-lg-6");
            } else {
                $('select[addr="section"]').parent().show();
                $('select[addr="province"]').parent().removeClass("col-lg-6").addClass("col-lg-4");
                $('select[addr="city"]').parent().removeClass("col-lg-6").addClass("col-lg-4");
            }
            $('select[addr="section"]').html("").append(html);
        },
        attribute: function (id) {
            var html = "";
            if (id == -1){
                html = "<option value='请选择' id='-1' preId='1'>请选择</option>";
            } else {
                $(address.attribute).each(function (index) {
                    var att = address.attribute[index];
                    if(att.parentId == address.addrId){
                        html = html +  "<option value='" + att.name + "' id='" + att.id + "' parentId='" + att.parentId + "' preId='1'>" + att.name + "</option>";
                    }
                });
            }
            return html;
        },
        selectedValue: function (obj) {
            address.addressValue = "";
            var province = $('select[addr="province"] option:selected').attr("value");
            var city = $('select[addr="city"] option:selected').attr("value");
            var section = $('select[addr="section"] option:selected').attr("value");
            if (province != "请选择" && province != "" && province != undefined && province != "undefined"){
                address.addressValue = province;
            }
            if (city != "请选择" && city != "" && city != undefined && city != "undefined"){
                if(address.addressValue != ""){
                    address.addressValue += "-" + city;
                } else {
                    address.addressValue = city;
                }
            }
            if (section != "请选择" && section != "" && section != undefined && section != "undefined"){
                if(address.addressValue != ""){
                    address.addressValue += "-" + section;
                } else {
                    address.addressValue = section;
                }
            }
            return address.addressValue;
        }

    })
})
